function NavBar() {
    return (
        <div className="navbar navbar-dark bg-primary">
            <a class="navbar-brand mx-4" href="#">BarberShop</a>
        </div>
    )
}


export default function AutClient() {
    return (
        <div>
            <NavBar/>
        </div>
    )
}
